  validar_form () {
    if (this.segment_value === 'participe') {
      return false;
    } else if (this.segment_value === 'aporte') {
      return false;
    } else if (this.segment_value === 'portafolio') {
      if (this.portafolio_form.value.abc === true) {
        return false;
      } else {
        return this.portafolio_form.invalid || this.get_total_portafolios () < 100;
      }
    } else if (this.segment_value === 'documentos') {
      return false;
    }

    return true;
  }

  async alerta_enviar (message: string) {
    const alert = await this.alertController.create({
      header: 'Datos incompletos',
      message: message,
      buttons: [
        {
          text: this.api.get_translate ('Aceptar')
        }
      ]
    });

    await alert.present();
  }

  abc_changed (event: any) {
    if (event === false) {
      while (this.portafolio_form.get ('portafolios').value.length) {
        this.portafolio_form.get ('portafolios').removeAt (0);
     }
    }
  }

  riqueza_changed (checked: any, val: string) {    
    let array: any [] = this.participe_form.get ('riqueza').value;
    if (checked) {;
      if (array.find (x => x === val) === undefined) {
        array.push (val);
      }
    } else {
      if (array.find (x => x === val) !== undefined) {
        for (let index = 0; index < array.length; index++) {
          if (array [index] === val) {
            array.splice (index, 1);
          }
        }
      }
    }
  }

  check_riqueza_value (value: string) {
    return (this.participe_form.get ('riqueza').value.find (x => x === value) !== undefined);
  }

